INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES ("あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, "2030/12/17 14:59:59", 0.0, 4, 24015, 10021, 4, 24, 110501, 0.0, "2019/07/31 12:00:00", 1, "カオリ（サマー）");
