INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES ("マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, "2030/12/17 14:59:59", 0.0, 4, 24017, 10021, 4, 24, 110501, 0.0, "2019/07/31 12:00:00", 3, "カオリ（サマー）");
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES ("なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 5.2, "2030/12/17 14:59:59", 0.0, 1, 24018, 10021, 2, 24, 110501, 0.0, "2019/07/31 12:00:00", 4, "カオリ（サマー）");
